import { Grid } from "@mui/material";
import Feed from "../Feed/Feed";
import LeftBar from "../LeftBar/LeftBar";

const AppBody = () => {
    return (
        <Grid container>
            <Grid item xs={2}>
                <LeftBar />
            </Grid>
            <Grid item xs={7}height={'100%'}>
                <Feed />
            </Grid>
            <Grid item xs={3}>
                <h1> Events </h1>
            </Grid>
        </Grid>
    );
}

export default AppBody;
